import { useState } from "react"
import Nav from "../components/Nav"
import { useCookies } from "react-cookie"
import axios from "axios"
import { useNavigate } from "react-router-dom"
import 'react-multiple-select-dropdown-lite/dist/index.css'
import Select from 'react-select'
import { Container } from "react-bootstrap";

const UserData = () => {

    let navigate = useNavigate()

    const [cookies, setCookie, removeCookie] = useCookies(["user"])
    const [inputList, setinputList] = useState([{ firstName: '', lastName: '' }]);
    const [formData, setFormData] = useState({
        user_id: cookies.UserId,
        name: "",
        field: "",
        skill: [],
        work: "",
        url: "",
        phone_number: "",
        matches: []
    })

    const handleinputchange = (e, index) => {
        const { name, value } = e.target;
        const list = [...inputList];
        list[index][name] = value;
        setinputList(list);

    }

    const handleremove = index => {
        const list = [...inputList];
        list.splice(index, 1);
        setinputList(list);
    }

    const handleaddclick = () => {
        setinputList([...inputList, { firstName: '', lastName: '' }]);
    }

    const handleSubmit = async (e) => {
        console.log("clicked here")
        e.preventDefault()
        console.log(formData)
        try {
            const response = await axios.put("http://localhost:8000/user", { formData })
            const success = response.status === 200

            if (success) navigate("/dashboard")
        } catch (err) {
            console.log(err)
        }
    }


    const handleChange = (e) => {
        console.log("e", e)
        const value = e.target.value
        const name = e.target.name

        setFormData((prevState) => ({ ...prevState, [name]: value }))
    }

    const handleChange2 = val => {

        setFormData((prevState) => ({ ...prevState, skill: val }))
    }

    const options = [
        { label: 'Html', value: 'Html' },
        { label: 'CSS', value: 'CSS' },
        { label: 'React', value: 'React' },
        { label: 'Node', value: 'Node' },
        { label: 'MongoDB', value: 'MongoDB' },
        { label: 'Express', value: 'Express' }
    ]


    return (
        <>
            <Nav minimal={true} setShowModel={() => { }} showModel={false} />

            <div className="userdata">
                <h2>User Details</h2>

                <form onSubmit={handleSubmit}>
                    <section>
                        <label htmlFor="university">University</label>
                        <input
                            id="university"
                            type="text"
                            name="university"
                            placeholder="Enter university"
                            required={true}
                            value={formData.university}
                            onChange={handleChange}
                        />

                        <label htmlFor="githublink">Github </label>
                        <input
                            id="githublink"
                            type="text"
                            name="githublink"
                            placeholder="Enter Profession"
                            required={true}
                            value={formData.githublink}
                            onChange={handleChange}
                        />
                        <label htmlFor="linkedinlink">LinkedIn </label>
                        <input
                            id="linkedinlink"
                            type="text"
                            name="linkedinlink"
                            placeholder="Enter Profession"
                            required={true}
                            value={formData.linkedinlink}
                            onChange={handleChange}
                        />
                        <label htmlFor="YOE">Years of Experience</label>
                        <input
                            id="YOE"
                            type="number"
                            name="YOE"
                            placeholder="Years"
                            required={true}
                            value={formData.YOE}
                            onChange={handleChange}
                        />
                        <input className="submit-button" type="submit" />
                    </section>
                    <section>
                        <label htmlFor="bio">Short Bio</label>
                        <input
                            id="bio"
                            type="text"
                            name="bio"
                            required={true}
                            value={formData.bio}
                            onChange={handleChange}
                        />
                        <Container className="content">
                            <div className="row">
                                <div className="col-sm-12">
                                    <h5 className="mt-3 mb-4 fw-bold">Dynamically add/remove inputs fields reactjs </h5>

                                    {
                                        inputList.map((x, i) => {
                                            return (
                                                <div className="row mb-3">
                                                    <div class="form-group col-md-4">
                                                        <label >First Name</label>
                                                        <input type="text" name="firstName" class="form-control" placeholder="Enter First Name" onChange={e => handleinputchange(e, i)} />
                                                    </div>
                                                    <div class="form-group col-md-4">
                                                        <label >Last Name</label>
                                                        <input type="text" name="lastName" class="form-control" placeholder="Enter Last Name" onChange={e => handleinputchange(e, i)} />
                                                    </div>
                                                    <div class="form-group col-md-2 mt-4">
                                                        {
                                                            inputList.length !== 1 &&
                                                            <button className="btn btn-danger mx-1" onClick={() => handleremove(i)}>Remove</button>
                                                        }
                                                        {inputList.length - 1 === i &&
                                                            <button className="btn btn-success" onClick={handleaddclick}>Add More</button>
                                                        }
                                                    </div>
                                                </div>
                                            );
                                        })}


                                </div>
                            </div>
                        </Container>
                    </section>
                </form>
            </div >

        </>
    )
}

export default UserData
